cription&quot;:&quot;Allow processing of a user&#039;s data to connect such user across multiple devices.&quot;,&quot;id&quot;:2},{&quot;name&quot;:&quot;Precise Geographic Location Data&quot;,&quot;description&quot;:&quot;Allow processing of a user&#039;s precise geographic location data in support of a purpose for which that certain third party has consent.&quot;,&quot;id&quot;:3}],&quot;vendorListVersion&quot;:187,&quot;purposes&quot;:[{&quot;name&quot;:&quot;Information storage and access&quot;,&quot;description&quot;:&quot;The storage of information, or access to information that is already stored, on your device such as advertising identifiers, device identifiers, cookies, and similar technologies.&quot;,&quot;id&quot;:1},{&quot;name&quot;:&quot;Personalisation&quot;,&quot;description&quot;:&quot;The collection and processing of information about your use of this service to subsequently personalise advertising and\\/or content for you in other contexts, such as on other websites or apps, over time. Typically, the content of the site or app is used to make inferences about your interests, which inform future selection of advertising and\\/or content.&quot;,&quot;id&quot;:2},{&quot;name&quot;:&quot;Ad selection, delivery, reporting&quot;,&quot;description&quot;:&quot;The collection of information, and combination with previously collected information, to select and deliver advertisements for you, and to measure the delivery and effectiveness of such advertisements. This includes using previously collected information about your interests to select ads, processing data about what advertisements were shown, how often they were shown, when and where they were shown, and whether you took any action related to the advertisement, including for example clicking an ad or making a purchase. This does not include personalisation, which is the collection and processing of information about your use of this service to subsequently personalise advertising and\\/or content fo